To solve the problem, we need to determine the geometric mean of the 27 positive integers that sum up to \(3^7\). Let's go through the steps in detail.

1. **Identify the sum of the integers:**
   The sum of the 27 positive integers is given as \(3^7\). We know that \(3^7 = 2187\).

2. **Understand the geometric mean:**
   The geometric mean of \(n\) positive numbers \(a_1, a_2, \ldots, a_n\) is given by the \(n\)-th root of their product, i.e., \(\sqrt[n]{a_1 \cdot a_2 \cdot \ldots \cdot a_n}\).

3. **Use the Arithmetic Mean-Geometric Mean Inequality (AM-GM Inequality):**
   The AM-GM Inequality states that for any set of non-negative real numbers, the arithmetic mean is at least as large as the geometric mean. For the integers \(a_1, a_2, \ldots, a_{27}\), we have:
   \[
   \frac{a_1 + a_2 + \cdots  + a_{27}}{27} \geq \sqrt[27]{a_1 \cdot a_2 \cdot \ldots \cdot a_{27}}
   \]
   Given that the sum of the integers is \(2187\), we get:
   \[
   \frac{2187}{27} \geq \sqrt[27]{a_1 \cdot a_2 \cdot \ldots \cdot a_{27}}
   \]
   Simplifying the left side, we get:
   \[
   81 \geq \sqrt[27]{a_1 \cdot a_2 \cdot \ldots \cdot a_{27}}
   \]
   This means that the geometric mean is at most 81. However, we need to check if this upper bound can be achieved.

4. **Check if the upper bound can be achieved:**
   The upper bound of 81 can be achieved if all the integers are equal. Let's assume each of the 27 integers is \(x\). Then we have:
   \[
   27x = 2187 \implies x = \frac {2187}{27} = 81
   \]
   So, each of the 27 integers is 81. The product of these 27 integers is:
   \[
   81^{27}
   \]
   The geometric mean is:
   \[
   \sqrt[27]{81^{27}} = 81
   \]
   Therefore, the geometric mean of these 27 integers is indeed 81.

Thus, the geometric mean of the 27 positive integers is \(\boxed{81}\).```
